Guava 29.0-jre, JDK 11:

When adding multiple ranges to a RangeSet concurrently, you might end up with this exception:

```
java.util.ConcurrentModificationException: null
	at java.base/java.util.TreeMap$NavigableSubMap$SubMapIterator.nextEntry(TreeMap.java:1700)
	at java.base/java.util.TreeMap$NavigableSubMap$SubMapEntryIterator.next(TreeMap.java:1748)
	at java.base/java.util.TreeMap$NavigableSubMap$SubMapEntryIterator.next(TreeMap.java:1742)
	at java.base/java.util.AbstractCollection.clear(AbstractCollection.java:446)
	at java.base/java.util.AbstractMap.clear(AbstractMap.java:297)
	at com.google.common.collect.TreeRangeSet.add(TreeRangeSet.java:214)
```

The root cause seems to be how submaps of a TreeMap are cleared: Using an iterator over the entryset.

At the moment, you can only create a RangeSet backed by a TreeMap, the contructor is private so as an API user you don't have any other choice than locking access to the whole RangeSet when modifying it.

Here is a test to trigger this exception (most of the times):

```java
RangeSet<Integer> rangeSet = TreeRangeSet.create();
ExecutorService executorService = Executors.newCachedThreadPool();
CountDownLatch cdl = new CountDownLatch(1000);
for (int i = 0; i < 1000; i++) {
	var range = Range.closed(i, i+5);
	executorService.submit(() -> {
		try {
			rangeSet.add(range);
		} catch(ConcurrentModificationException e) {
			e.printStackTrace();
		} finally {
			cdl.countDown();
		}
	});
}
cdl.await();
```

I'm wondering if I'm doing something wrong here:

I have a possibly-mutable cache key `K`, a function to freeze it `K -> FrozenK`, and a function to compute value: `K -> V`.

The `LoadingCache<K,V>` does not let me freeze `K` on miss - it just computes `V` from `K`, and presumably retains a reference to `K` and `V`.

The way I can do this is something like:

```java
@Nullable v = CACHE.getIfPresent(k);
if (v != null) {
  return v;
}
FrozenK frozenK = freeze(k);
v = computeValue(frozenK);
CACHE.put(frozenK, v);
return v;
```

Is there a better way to do something like this? Is maybe-mutable-keys not a common use case for `Cache` inside of Google? In practice, `K` is `Set` and `FrozenK` is `ImmutableSet`, so I assumed this would come up.

```java
public class BloomFilterTest {
    public static void main(String[] args) {
        BloomFilter<Integer> filter = BloomFilter.create(Funnels.integerFunnel(), 5000, 0.01);
        // insert more than 5000
        IntStream.range(0, 100_000).forEach(filter::put);
        // get the result is always true
        boolean b = filter.mightContain(123456789);
        System.out.println(b);
    }
}
```
I know its my fault, but can throw a exception or some other way to notify user this thing?

The [doc](https://github.com/google/guava/wiki/GraphsExplained#immutable-implementations), if I understand it correctly, states that iteration order of successors nodes should follow insertion order in the following case.

```
Person root = new Person("ROOT");
Person personLeft = new Person("l");
Person personRight = new Person("r");
ImmutableValueGraph.Builder<Person, Integer> builder = ValueGraphBuilder.directed().immutable();
builder.putEdgeValue(root, personLeft, 1);
builder.putEdgeValue(root, personRight, 2);
ImmutableValueGraph<Person, Integer> tree = builder.build();
Iterator<Person> iterator = tree.successors(root).iterator();
LOGGER.info("First successor of root: {}.", iterator.next());
LOGGER.info("Second successor of root: {}.", iterator.next());
```
I expect, thus, to see “l” as the first successor of root, and “r” as the second one. But I observe the reverse instead.

Here is the `Person` class.
```
private static class Person {
	String name;

	public Person(String name) {
		this.name = name;
	}

	@Override
	public String toString() {
		return name;
	}
}
```
(This does not happen, on my computer where I tested this, with `String` instead of `Person`, or with `Graph` instead of `ValueGraph`.)

